import React from "react";
export default function Header() {
  return (
    <header>
      <nav>
        <ul>
          <li>
            <h3>Meme Generator</h3>
          </li>
          <li>
            <p>React Course-Project 3</p>
          </li>
        </ul>
      </nav>
    </header>
  );
}
